('THIEN_CO_TU_TUC_BINH', 'Thiên Cơ bình địa tại cung Tử Tức thể hiện khả năng con cái, giáo dục, tương lai ở mức độ trung bình, không có sự nổi bật đặc biệt về trí tuệ. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thiên Cơ bình địa tại Tử Tức thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể con cái, giáo dục, tương lai ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Tử Tức của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển trí tuệ để nâng cao chất lượng.', 'neutral', 0),
('THIEN_CO_TU_TUC_HAM', 'Thiên Cơ hãm địa tại cung Tử Tức cho thấy khó khăn trong việc con cái, giáo dục, tương lai. hãm địa là trạng thái bất lợi, khiến Thiên Cơ không thể phát huy các mặt tích cực. Người có Thiên Cơ hãm địa tại Tử Tức thường gặp khó khăn trong việc trí tuệ, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Tử Tức của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THIEN_CO_PHUC_DUC_MIEU', 'Thiên Cơ miếu địa tại cung Phúc Đức thể hiện khả năng trí tuệ và linh hoạt trong lĩnh vực phúc đức, tâm linh, truyền thống. Sao này chủ về trí tuệ, khi ở miếu địa tại Phúc Đức tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Cơ miếu địa tại Phúc Đức thường có khả năng thông minh, dễ dàng đạt được thành tựu và phát triển. Tính cách trí tuệ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường phúc đức, tâm linh, truyền thống một cách hiệu quả, với khả năng linh hoạt và thông minh. Phúc Đức của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua trí tuệ.', 'positive', 0),
