INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THIEN_CO_HUYNH_DE_MIEU', 'Thiên Cơ miếu địa tại cung Huynh Đệ thể hiện khả năng trí tuệ và linh hoạt trong lĩnh vực anh chị em, bạn bè, tương trợ. Sao này chủ về trí tuệ, khi ở miếu địa tại Huynh Đệ tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Cơ miếu địa tại Huynh Đệ thường có khả năng thông minh, dễ dàng đạt được thành tựu và phát triển. Tính cách trí tuệ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường anh chị em, bạn bè, tương trợ một cách hiệu quả, với khả năng linh hoạt và thông minh. Huynh Đệ của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua trí tuệ.', 'positive', 0),
('THIEN_CO_HUYNH_DE_VUONG', 'Thiên Cơ vượng địa tại cung Huynh Đệ thể hiện khả năng trí tuệ và linh hoạt trong lĩnh vực anh chị em, bạn bè, tương trợ. Sao này chủ về trí tuệ, khi ở vượng địa tại Huynh Đệ tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Cơ vượng địa tại Huynh Đệ thường có khả năng thông minh, dễ dàng đạt được thành tựu và phát triển. Tính cách trí tuệ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường anh chị em, bạn bè, tương trợ một cách hiệu quả, với khả năng linh hoạt và thông minh. Huynh Đệ của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua trí tuệ.', 'positive', 0),
