('THAI_AM_QUAN_LOC_BINH', 'Thái Âm bình địa tại cung Quan Lộc thể hiện khả năng công việc, sự nghiệp, địa vị ở mức độ trung bình, không có sự nổi bật đặc biệt về nhân từ. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thái Âm bình địa tại Quan Lộc thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể công việc, sự nghiệp, địa vị ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Quan Lộc của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển nhân từ để nâng cao chất lượng.', 'neutral', 0),
('THAI_AM_QUAN_LOC_HAM', 'Thái Âm hãm địa tại cung Quan Lộc cho thấy khó khăn trong việc công việc, sự nghiệp, địa vị. hãm địa là trạng thái bất lợi, khiến Thái Âm không thể phát huy các mặt tích cực. Người có Thái Âm hãm địa tại Quan Lộc thường gặp khó khăn trong việc nhân từ, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Quan Lộc của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
