INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THAI_AM_TAT_ACH_MIEU', 'Thái Âm miếu địa tại cung Tật Ách thể hiện khả năng nhân từ và hòa nhã trong lĩnh vực sức khỏe, thể trạng, bệnh tật. Sao này chủ về nhân từ, khi ở miếu địa tại Tật Ách tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Âm miếu địa tại Tật Ách thường có khả năng dịu dàng, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường sức khỏe, thể trạng, bệnh tật một cách hiệu quả, với khả năng hòa nhã và dịu dàng. Tật Ách của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
('THAI_AM_TAT_ACH_VUONG', 'Thái Âm vượng địa tại cung Tật Ách thể hiện khả năng nhân từ và hòa nhã trong lĩnh vực sức khỏe, thể trạng, bệnh tật. Sao này chủ về nhân từ, khi ở vượng địa tại Tật Ách tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Âm vượng địa tại Tật Ách thường có khả năng dịu dàng, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường sức khỏe, thể trạng, bệnh tật một cách hiệu quả, với khả năng hòa nhã và dịu dàng. Tật Ách của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
