INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THAI_AM_THIEN_DI_MIEU', 'Thái Âm miếu địa tại cung Thiên Di thể hiện khả năng nhân từ và hòa nhã trong lĩnh vực di chuyển, du lịch, thay đổi. Sao này chủ về nhân từ, khi ở miếu địa tại Thiên Di tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Âm miếu địa tại Thiên Di thường có khả năng dịu dàng, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường di chuyển, du lịch, thay đổi một cách hiệu quả, với khả năng hòa nhã và dịu dàng. Thiên Di của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
('THAI_AM_THIEN_DI_VUONG', 'Thái Âm vượng địa tại cung Thiên Di thể hiện khả năng nhân từ và hòa nhã trong lĩnh vực di chuyển, du lịch, thay đổi. Sao này chủ về nhân từ, khi ở vượng địa tại Thiên Di tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Âm vượng địa tại Thiên Di thường có khả năng dịu dàng, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường di chuyển, du lịch, thay đổi một cách hiệu quả, với khả năng hòa nhã và dịu dàng. Thiên Di của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
('THAI_AM_THIEN_DI_DAC', 'Thái Âm đắc địa tại cung Thiên Di thể hiện khả năng nhân từ và hòa nhã trong lĩnh vực di chuyển, du lịch, thay đổi. Sao này chủ về nhân từ, khi ở đắc địa tại Thiên Di tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Âm đắc địa tại Thiên Di thường có khả năng dịu dàng, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường di chuyển, du lịch, thay đổi một cách hiệu quả, với khả năng hòa nhã và dịu dàng. Thiên Di của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
('THAI_AM_THIEN_DI_BINH', 'Thái Âm bình địa tại cung Thiên Di thể hiện khả năng di chuyển, du lịch, thay đổi ở mức độ trung bình, không có sự nổi bật đặc biệt về nhân từ. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thái Âm bình địa tại Thiên Di thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể di chuyển, du lịch, thay đổi ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Thiên Di của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển nhân từ để nâng cao chất lượng.', 'neutral', 0),
('THAI_AM_THIEN_DI_HAM', 'Thái Âm hãm địa tại cung Thiên Di cho thấy khó khăn trong việc di chuyển, du lịch, thay đổi. hãm địa là trạng thái bất lợi, khiến Thái Âm không thể phát huy các mặt tích cực. Người có Thái Âm hãm địa tại Thiên Di thường gặp khó khăn trong việc nhân từ, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Thiên Di của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THAI_AM_NO_BOC_MIEU', 'Thái Âm miếu địa tại cung Nô Bộc thể hiện khả năng nhân từ và hòa nhã trong lĩnh vực bạn bè, đồng nghiệp, hợp tác. Sao này chủ về nhân từ, khi ở miếu địa tại Nô Bộc tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Âm miếu địa tại Nô Bộc thường có khả năng dịu dàng, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường bạn bè, đồng nghiệp, hợp tác một cách hiệu quả, với khả năng hòa nhã và dịu dàng. Nô Bộc của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
