('THAI_AM_HUYNH_DE_BINH', 'Thái Âm bình địa tại cung Huynh Đệ thể hiện khả năng anh chị em, bạn bè, tương trợ ở mức độ trung bình, không có sự nổi bật đặc biệt về nhân từ. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thái Âm bình địa tại Huynh Đệ thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể anh chị em, bạn bè, tương trợ ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Huynh Đệ của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển nhân từ để nâng cao chất lượng.', 'neutral', 0),
('THAI_AM_HUYNH_DE_HAM', 'Thái Âm hãm địa tại cung Huynh Đệ cho thấy khó khăn trong việc anh chị em, bạn bè, tương trợ. hãm địa là trạng thái bất lợi, khiến Thái Âm không thể phát huy các mặt tích cực. Người có Thái Âm hãm địa tại Huynh Đệ thường gặp khó khăn trong việc nhân từ, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Huynh Đệ của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THAI_DUONG_QUAN_LOC_MIEU', 'Thái Dương miếu địa tại cung Quan Lộc thể hiện khả năng nhiệt huyết và năng động trong lĩnh vực công việc, sự nghiệp, địa vị. Sao này chủ về nhiệt huyết, khi ở miếu địa tại Quan Lộc tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Dương miếu địa tại Quan Lộc thường có khả năng tích cực, dễ dàng đạt được thành tựu và phát triển. Tính cách nhiệt huyết giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường công việc, sự nghiệp, địa vị một cách hiệu quả, với khả năng năng động và tích cực. Quan Lộc của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhiệt huyết.', 'positive', 0),
