('THAI_DUONG_TAI_BACH_BINH', 'Thái Dương bình địa tại cung Tài Bạch thể hiện khả năng tiền bạc, tài chính, thu nhập ở mức độ trung bình, không có sự nổi bật đặc biệt về nhiệt huyết. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thái Dương bình địa tại Tài Bạch thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể tiền bạc, tài chính, thu nhập ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Tài Bạch của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển nhiệt huyết để nâng cao chất lượng.', 'neutral', 0),
('THAI_DUONG_TAI_BACH_HAM', 'Thái Dương hãm địa tại cung Tài Bạch cho thấy khó khăn trong việc tiền bạc, tài chính, thu nhập. hãm địa là trạng thái bất lợi, khiến Thái Dương không thể phát huy các mặt tích cực. Người có Thái Dương hãm địa tại Tài Bạch thường gặp khó khăn trong việc nhiệt huyết, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Tài Bạch của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THAI_DUONG_PHU_THE_MIEU', 'Thái Dương miếu địa tại cung Phu Thê thể hiện khả năng nhiệt huyết và năng động trong lĩnh vực hôn nhân, mối quan hệ vợ chồng. Sao này chủ về nhiệt huyết, khi ở miếu địa tại Phu Thê tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Dương miếu địa tại Phu Thê thường có khả năng tích cực, dễ dàng đạt được thành tựu và phát triển. Tính cách nhiệt huyết giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường hôn nhân, mối quan hệ vợ chồng một cách hiệu quả, với khả năng năng động và tích cực. Phu Thê của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhiệt huyết.', 'positive', 0),
('THAI_DUONG_PHU_THE_VUONG', 'Thái Dương vượng địa tại cung Phu Thê thể hiện khả năng nhiệt huyết và năng động trong lĩnh vực hôn nhân, mối quan hệ vợ chồng. Sao này chủ về nhiệt huyết, khi ở vượng địa tại Phu Thê tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Dương vượng địa tại Phu Thê thường có khả năng tích cực, dễ dàng đạt được thành tựu và phát triển. Tính cách nhiệt huyết giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường hôn nhân, mối quan hệ vợ chồng một cách hiệu quả, với khả năng năng động và tích cực. Phu Thê của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhiệt huyết.', 'positive', 0),
('THAI_DUONG_PHU_THE_DAC', 'Thái Dương đắc địa tại cung Phu Thê thể hiện khả năng nhiệt huyết và năng động trong lĩnh vực hôn nhân, mối quan hệ vợ chồng. Sao này chủ về nhiệt huyết, khi ở đắc địa tại Phu Thê tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Dương đắc địa tại Phu Thê thường có khả năng tích cực, dễ dàng đạt được thành tựu và phát triển. Tính cách nhiệt huyết giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường hôn nhân, mối quan hệ vợ chồng một cách hiệu quả, với khả năng năng động và tích cực. Phu Thê của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhiệt huyết.', 'positive', 0),
('THAI_DUONG_PHU_THE_BINH', 'Thái Dương bình địa tại cung Phu Thê thể hiện khả năng hôn nhân, mối quan hệ vợ chồng ở mức độ trung bình, không có sự nổi bật đặc biệt về nhiệt huyết. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thái Dương bình địa tại Phu Thê thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể hôn nhân, mối quan hệ vợ chồng ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Phu Thê của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển nhiệt huyết để nâng cao chất lượng.', 'neutral', 0),
('THAI_DUONG_PHU_THE_HAM', 'Thái Dương hãm địa tại cung Phu Thê cho thấy khó khăn trong việc hôn nhân, mối quan hệ vợ chồng. hãm địa là trạng thái bất lợi, khiến Thái Dương không thể phát huy các mặt tích cực. Người có Thái Dương hãm địa tại Phu Thê thường gặp khó khăn trong việc nhiệt huyết, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Phu Thê của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
