('THAI_DUONG_TU_TUC_HAM', 'Thái Dương hãm địa tại cung Tử Tức cho thấy khó khăn trong việc con cái, giáo dục, tương lai. hãm địa là trạng thái bất lợi, khiến Thái Dương không thể phát huy các mặt tích cực. Người có Thái Dương hãm địa tại Tử Tức thường gặp khó khăn trong việc nhiệt huyết, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Tử Tức của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THAI_DUONG_PHUC_DUC_MIEU', 'Thái Dương miếu địa tại cung Phúc Đức thể hiện khả năng nhiệt huyết và năng động trong lĩnh vực phúc đức, tâm linh, truyền thống. Sao này chủ về nhiệt huyết, khi ở miếu địa tại Phúc Đức tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Dương miếu địa tại Phúc Đức thường có khả năng tích cực, dễ dàng đạt được thành tựu và phát triển. Tính cách nhiệt huyết giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường phúc đức, tâm linh, truyền thống một cách hiệu quả, với khả năng năng động và tích cực. Phúc Đức của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhiệt huyết.', 'positive', 0),
('THAI_DUONG_PHUC_DUC_VUONG', 'Thái Dương vượng địa tại cung Phúc Đức thể hiện khả năng nhiệt huyết và năng động trong lĩnh vực phúc đức, tâm linh, truyền thống. Sao này chủ về nhiệt huyết, khi ở vượng địa tại Phúc Đức tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Dương vượng địa tại Phúc Đức thường có khả năng tích cực, dễ dàng đạt được thành tựu và phát triển. Tính cách nhiệt huyết giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường phúc đức, tâm linh, truyền thống một cách hiệu quả, với khả năng năng động và tích cực. Phúc Đức của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhiệt huyết.', 'positive', 0),
('THAI_DUONG_PHUC_DUC_DAC', 'Thái Dương đắc địa tại cung Phúc Đức thể hiện khả năng nhiệt huyết và năng động trong lĩnh vực phúc đức, tâm linh, truyền thống. Sao này chủ về nhiệt huyết, khi ở đắc địa tại Phúc Đức tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Dương đắc địa tại Phúc Đức thường có khả năng tích cực, dễ dàng đạt được thành tựu và phát triển. Tính cách nhiệt huyết giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường phúc đức, tâm linh, truyền thống một cách hiệu quả, với khả năng năng động và tích cực. Phúc Đức của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhiệt huyết.', 'positive', 0),
('THAI_DUONG_PHUC_DUC_BINH', 'Thái Dương bình địa tại cung Phúc Đức thể hiện khả năng phúc đức, tâm linh, truyền thống ở mức độ trung bình, không có sự nổi bật đặc biệt về nhiệt huyết. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thái Dương bình địa tại Phúc Đức thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể phúc đức, tâm linh, truyền thống ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Phúc Đức của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển nhiệt huyết để nâng cao chất lượng.', 'neutral', 0),
('THAI_DUONG_PHUC_DUC_HAM', 'Thái Dương hãm địa tại cung Phúc Đức cho thấy khó khăn trong việc phúc đức, tâm linh, truyền thống. hãm địa là trạng thái bất lợi, khiến Thái Dương không thể phát huy các mặt tích cực. Người có Thái Dương hãm địa tại Phúc Đức thường gặp khó khăn trong việc nhiệt huyết, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Phúc Đức của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
