INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THAI_DUONG_HUYNH_DE_MIEU', 'Thái Dương miếu địa tại cung Huynh Đệ thể hiện khả năng nhiệt huyết và năng động trong lĩnh vực anh chị em, bạn bè, tương trợ. Sao này chủ về nhiệt huyết, khi ở miếu địa tại Huynh Đệ tạo nên khả năng phát huy đầy đủ tính chất. Người có Thái Dương miếu địa tại Huynh Đệ thường có khả năng tích cực, dễ dàng đạt được thành tựu và phát triển. Tính cách nhiệt huyết giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường anh chị em, bạn bè, tương trợ một cách hiệu quả, với khả năng năng động và tích cực. Huynh Đệ của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhiệt huyết.', 'positive', 0),
