INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('VU_KHUC_TAT_ACH_MIEU', 'Vũ Khúc miếu địa tại cung Tật Ách thể hiện khả năng tài chính và kinh doanh trong lĩnh vực sức khỏe, thể trạng, bệnh tật. Sao này chủ về tài chính, khi ở miếu địa tại Tật Ách tạo nên khả năng phát huy đầy đủ tính chất. Người có Vũ Khúc miếu địa tại Tật Ách thường có khả năng tổ chức, dễ dàng đạt được thành tựu và phát triển. Tính cách tài chính giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường sức khỏe, thể trạng, bệnh tật một cách hiệu quả, với khả năng kinh doanh và tổ chức. Tật Ách của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua tài chính.', 'positive', 0),
('VU_KHUC_TAT_ACH_VUONG', 'Vũ Khúc vượng địa tại cung Tật Ách thể hiện khả năng tài chính và kinh doanh trong lĩnh vực sức khỏe, thể trạng, bệnh tật. Sao này chủ về tài chính, khi ở vượng địa tại Tật Ách tạo nên khả năng phát huy đầy đủ tính chất. Người có Vũ Khúc vượng địa tại Tật Ách thường có khả năng tổ chức, dễ dàng đạt được thành tựu và phát triển. Tính cách tài chính giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường sức khỏe, thể trạng, bệnh tật một cách hiệu quả, với khả năng kinh doanh và tổ chức. Tật Ách của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua tài chính.', 'positive', 0),
