('VU_KHUC_TAT_ACH_BINH', 'Vũ Khúc bình địa tại cung Tật Ách thể hiện khả năng sức khỏe, thể trạng, bệnh tật ở mức độ trung bình, không có sự nổi bật đặc biệt về tài chính. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Vũ Khúc bình địa tại Tật Ách thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể sức khỏe, thể trạng, bệnh tật ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Tật Ách của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển tài chính để nâng cao chất lượng.', 'neutral', 0),
('VU_KHUC_TAT_ACH_HAM', 'Vũ Khúc hãm địa tại cung Tật Ách cho thấy khó khăn trong việc sức khỏe, thể trạng, bệnh tật. hãm địa là trạng thái bất lợi, khiến Vũ Khúc không thể phát huy các mặt tích cực. Người có Vũ Khúc hãm địa tại Tật Ách thường gặp khó khăn trong việc tài chính, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Tật Ách của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
