('THIEN_TUONG_PHU_THE_MIEU', 'Thiên Tướng miếu địa tại cung Phu Thê thể hiện khả năng ổn định và bảo vệ trong lĩnh vực hôn nhân, mối quan hệ vợ chồng. Sao này chủ về ổn định, khi ở miếu địa tại Phu Thê tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Tướng miếu địa tại Phu Thê thường có khả năng trung thành, dễ dàng đạt được thành tựu và phát triển. Tính cách ổn định giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường hôn nhân, mối quan hệ vợ chồng một cách hiệu quả, với khả năng bảo vệ và trung thành. Phu Thê của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua ổn định.', 'positive', 0),
('THIEN_TUONG_PHU_THE_VUONG', 'Thiên Tướng vượng địa tại cung Phu Thê thể hiện khả năng ổn định và bảo vệ trong lĩnh vực hôn nhân, mối quan hệ vợ chồng. Sao này chủ về ổn định, khi ở vượng địa tại Phu Thê tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Tướng vượng địa tại Phu Thê thường có khả năng trung thành, dễ dàng đạt được thành tựu và phát triển. Tính cách ổn định giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường hôn nhân, mối quan hệ vợ chồng một cách hiệu quả, với khả năng bảo vệ và trung thành. Phu Thê của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua ổn định.', 'positive', 0),
('THIEN_TUONG_PHU_THE_DAC', 'Thiên Tướng đắc địa tại cung Phu Thê thể hiện khả năng ổn định và bảo vệ trong lĩnh vực hôn nhân, mối quan hệ vợ chồng. Sao này chủ về ổn định, khi ở đắc địa tại Phu Thê tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Tướng đắc địa tại Phu Thê thường có khả năng trung thành, dễ dàng đạt được thành tựu và phát triển. Tính cách ổn định giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường hôn nhân, mối quan hệ vợ chồng một cách hiệu quả, với khả năng bảo vệ và trung thành. Phu Thê của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua ổn định.', 'positive', 0),
('THIEN_TUONG_PHU_THE_BINH', 'Thiên Tướng bình địa tại cung Phu Thê thể hiện khả năng hôn nhân, mối quan hệ vợ chồng ở mức độ trung bình, không có sự nổi bật đặc biệt về ổn định. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thiên Tướng bình địa tại Phu Thê thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể hôn nhân, mối quan hệ vợ chồng ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Phu Thê của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển ổn định để nâng cao chất lượng.', 'neutral', 0),
('THIEN_TUONG_PHU_THE_HAM', 'Thiên Tướng hãm địa tại cung Phu Thê cho thấy khó khăn trong việc hôn nhân, mối quan hệ vợ chồng. hãm địa là trạng thái bất lợi, khiến Thiên Tướng không thể phát huy các mặt tích cực. Người có Thiên Tướng hãm địa tại Phu Thê thường gặp khó khăn trong việc ổn định, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Phu Thê của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
