('THIEN_TUONG_PHUC_DUC_BINH', 'Thiên Tướng bình địa tại cung Phúc Đức thể hiện khả năng phúc đức, tâm linh, truyền thống ở mức độ trung bình, không có sự nổi bật đặc biệt về ổn định. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thiên Tướng bình địa tại Phúc Đức thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể phúc đức, tâm linh, truyền thống ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Phúc Đức của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển ổn định để nâng cao chất lượng.', 'neutral', 0),
('THIEN_TUONG_PHUC_DUC_HAM', 'Thiên Tướng hãm địa tại cung Phúc Đức cho thấy khó khăn trong việc phúc đức, tâm linh, truyền thống. hãm địa là trạng thái bất lợi, khiến Thiên Tướng không thể phát huy các mặt tích cực. Người có Thiên Tướng hãm địa tại Phúc Đức thường gặp khó khăn trong việc ổn định, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Phúc Đức của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THIEN_TUONG_THIEN_DI_MIEU', 'Thiên Tướng miếu địa tại cung Thiên Di thể hiện khả năng ổn định và bảo vệ trong lĩnh vực di chuyển, du lịch, thay đổi. Sao này chủ về ổn định, khi ở miếu địa tại Thiên Di tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Tướng miếu địa tại Thiên Di thường có khả năng trung thành, dễ dàng đạt được thành tựu và phát triển. Tính cách ổn định giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường di chuyển, du lịch, thay đổi một cách hiệu quả, với khả năng bảo vệ và trung thành. Thiên Di của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua ổn định.', 'positive', 0),
