('THIEN_TUONG_DIEN_TRACH_HAM', 'Thiên Tướng hãm địa tại cung Điền Trạch cho thấy khó khăn trong việc nhà cửa, bất động sản, tài sản. hãm địa là trạng thái bất lợi, khiến Thiên Tướng không thể phát huy các mặt tích cực. Người có Thiên Tướng hãm địa tại Điền Trạch thường gặp khó khăn trong việc ổn định, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Điền Trạch của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THIEN_TUONG_PHU_MAU_MIEU', 'Thiên Tướng miếu địa tại cung Phụ Mẫu thể hiện khả năng ổn định và bảo vệ trong lĩnh vực cha mẹ, học tập, giáo dục. Sao này chủ về ổn định, khi ở miếu địa tại Phụ Mẫu tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Tướng miếu địa tại Phụ Mẫu thường có khả năng trung thành, dễ dàng đạt được thành tựu và phát triển. Tính cách ổn định giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường cha mẹ, học tập, giáo dục một cách hiệu quả, với khả năng bảo vệ và trung thành. Phụ Mẫu của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua ổn định.', 'positive', 0),
