('THIEN_TUONG_PHU_MAU_BINH', 'Thiên Tướng bình địa tại cung Phụ Mẫu thể hiện khả năng cha mẹ, học tập, giáo dục ở mức độ trung bình, không có sự nổi bật đặc biệt về ổn định. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thiên Tướng bình địa tại Phụ Mẫu thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể cha mẹ, học tập, giáo dục ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Phụ Mẫu của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển ổn định để nâng cao chất lượng.', 'neutral', 0),
('THIEN_TUONG_PHU_MAU_HAM', 'Thiên Tướng hãm địa tại cung Phụ Mẫu cho thấy khó khăn trong việc cha mẹ, học tập, giáo dục. hãm địa là trạng thái bất lợi, khiến Thiên Tướng không thể phát huy các mặt tích cực. Người có Thiên Tướng hãm địa tại Phụ Mẫu thường gặp khó khăn trong việc ổn định, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Phụ Mẫu của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
