INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THIEN_LUONG_QUAN_LOC_MIEU', 'Thiên Lương miếu địa tại cung Quan Lộc thể hiện khả năng nhân từ và từ thiện trong lĩnh vực công việc, sự nghiệp, địa vị. Sao này chủ về nhân từ, khi ở miếu địa tại Quan Lộc tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Lương miếu địa tại Quan Lộc thường có khả năng hòa nhã, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường công việc, sự nghiệp, địa vị một cách hiệu quả, với khả năng từ thiện và hòa nhã. Quan Lộc của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
