('THIEN_LUONG_TAI_BACH_MIEU', 'Thiên Lương miếu địa tại cung Tài Bạch thể hiện khả năng nhân từ và từ thiện trong lĩnh vực tiền bạc, tài chính, thu nhập. Sao này chủ về nhân từ, khi ở miếu địa tại Tài Bạch tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Lương miếu địa tại Tài Bạch thường có khả năng hòa nhã, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường tiền bạc, tài chính, thu nhập một cách hiệu quả, với khả năng từ thiện và hòa nhã. Tài Bạch của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
('THIEN_LUONG_TAI_BACH_VUONG', 'Thiên Lương vượng địa tại cung Tài Bạch thể hiện khả năng nhân từ và từ thiện trong lĩnh vực tiền bạc, tài chính, thu nhập. Sao này chủ về nhân từ, khi ở vượng địa tại Tài Bạch tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Lương vượng địa tại Tài Bạch thường có khả năng hòa nhã, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường tiền bạc, tài chính, thu nhập một cách hiệu quả, với khả năng từ thiện và hòa nhã. Tài Bạch của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
('THIEN_LUONG_TAI_BACH_DAC', 'Thiên Lương đắc địa tại cung Tài Bạch thể hiện khả năng nhân từ và từ thiện trong lĩnh vực tiền bạc, tài chính, thu nhập. Sao này chủ về nhân từ, khi ở đắc địa tại Tài Bạch tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Lương đắc địa tại Tài Bạch thường có khả năng hòa nhã, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường tiền bạc, tài chính, thu nhập một cách hiệu quả, với khả năng từ thiện và hòa nhã. Tài Bạch của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
('THIEN_LUONG_TAI_BACH_BINH', 'Thiên Lương bình địa tại cung Tài Bạch thể hiện khả năng tiền bạc, tài chính, thu nhập ở mức độ trung bình, không có sự nổi bật đặc biệt về nhân từ. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thiên Lương bình địa tại Tài Bạch thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể tiền bạc, tài chính, thu nhập ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Tài Bạch của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển nhân từ để nâng cao chất lượng.', 'neutral', 0),
('THIEN_LUONG_TAI_BACH_HAM', 'Thiên Lương hãm địa tại cung Tài Bạch cho thấy khó khăn trong việc tiền bạc, tài chính, thu nhập. hãm địa là trạng thái bất lợi, khiến Thiên Lương không thể phát huy các mặt tích cực. Người có Thiên Lương hãm địa tại Tài Bạch thường gặp khó khăn trong việc nhân từ, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Tài Bạch của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
