('THIEN_LUONG_TU_TUC_MIEU', 'Thiên Lương miếu địa tại cung Tử Tức thể hiện khả năng nhân từ và từ thiện trong lĩnh vực con cái, giáo dục, tương lai. Sao này chủ về nhân từ, khi ở miếu địa tại Tử Tức tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Lương miếu địa tại Tử Tức thường có khả năng hòa nhã, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường con cái, giáo dục, tương lai một cách hiệu quả, với khả năng từ thiện và hòa nhã. Tử Tức của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
