('THIEN_LUONG_TU_TUC_DAC', 'Thiên Lương đắc địa tại cung Tử Tức thể hiện khả năng nhân từ và từ thiện trong lĩnh vực con cái, giáo dục, tương lai. Sao này chủ về nhân từ, khi ở đắc địa tại Tử Tức tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Lương đắc địa tại Tử Tức thường có khả năng hòa nhã, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường con cái, giáo dục, tương lai một cách hiệu quả, với khả năng từ thiện và hòa nhã. Tử Tức của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
('THIEN_LUONG_TU_TUC_BINH', 'Thiên Lương bình địa tại cung Tử Tức thể hiện khả năng con cái, giáo dục, tương lai ở mức độ trung bình, không có sự nổi bật đặc biệt về nhân từ. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thiên Lương bình địa tại Tử Tức thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể con cái, giáo dục, tương lai ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Tử Tức của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển nhân từ để nâng cao chất lượng.', 'neutral', 0),
('THIEN_LUONG_TU_TUC_HAM', 'Thiên Lương hãm địa tại cung Tử Tức cho thấy khó khăn trong việc con cái, giáo dục, tương lai. hãm địa là trạng thái bất lợi, khiến Thiên Lương không thể phát huy các mặt tích cực. Người có Thiên Lương hãm địa tại Tử Tức thường gặp khó khăn trong việc nhân từ, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Tử Tức của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
