('THIEN_LUONG_THIEN_DI_MIEU', 'Thiên Lương miếu địa tại cung Thiên Di thể hiện khả năng nhân từ và từ thiện trong lĩnh vực di chuyển, du lịch, thay đổi. Sao này chủ về nhân từ, khi ở miếu địa tại Thiên Di tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Lương miếu địa tại Thiên Di thường có khả năng hòa nhã, dễ dàng đạt được thành tựu và phát triển. Tính cách nhân từ giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường di chuyển, du lịch, thay đổi một cách hiệu quả, với khả năng từ thiện và hòa nhã. Thiên Di của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua nhân từ.', 'positive', 0),
