('LIEM_TRINH_TAT_ACH_MIEU', 'Liêm Trinh miếu địa tại cung Tật Ách thể hiện khả năng thanh cao và trung thực trong lĩnh vực sức khỏe, thể trạng, bệnh tật. Sao này chủ về thanh cao, khi ở miếu địa tại Tật Ách tạo nên khả năng phát huy đầy đủ tính chất. Người có Liêm Trinh miếu địa tại Tật Ách thường có khả năng chính trực, dễ dàng đạt được thành tựu và phát triển. Tính cách thanh cao giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường sức khỏe, thể trạng, bệnh tật một cách hiệu quả, với khả năng trung thực và chính trực. Tật Ách của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua thanh cao.', 'positive', 0),
('LIEM_TRINH_TAT_ACH_VUONG', 'Liêm Trinh vượng địa tại cung Tật Ách thể hiện khả năng thanh cao và trung thực trong lĩnh vực sức khỏe, thể trạng, bệnh tật. Sao này chủ về thanh cao, khi ở vượng địa tại Tật Ách tạo nên khả năng phát huy đầy đủ tính chất. Người có Liêm Trinh vượng địa tại Tật Ách thường có khả năng chính trực, dễ dàng đạt được thành tựu và phát triển. Tính cách thanh cao giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường sức khỏe, thể trạng, bệnh tật một cách hiệu quả, với khả năng trung thực và chính trực. Tật Ách của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua thanh cao.', 'positive', 0),
