('LIEM_TRINH_TAT_ACH_BINH', 'Liêm Trinh bình địa tại cung Tật Ách thể hiện khả năng sức khỏe, thể trạng, bệnh tật ở mức độ trung bình, không có sự nổi bật đặc biệt về thanh cao. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Liêm Trinh bình địa tại Tật Ách thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể sức khỏe, thể trạng, bệnh tật ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Tật Ách của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển thanh cao để nâng cao chất lượng.', 'neutral', 0),
('LIEM_TRINH_TAT_ACH_HAM', 'Liêm Trinh hãm địa tại cung Tật Ách cho thấy khó khăn trong việc sức khỏe, thể trạng, bệnh tật. hãm địa là trạng thái bất lợi, khiến Liêm Trinh không thể phát huy các mặt tích cực. Người có Liêm Trinh hãm địa tại Tật Ách thường gặp khó khăn trong việc thanh cao, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Tật Ách của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
