('LIEM_TRINH_THIEN_DI_MIEU', 'Liêm Trinh miếu địa tại cung Thiên Di thể hiện khả năng thanh cao và trung thực trong lĩnh vực di chuyển, du lịch, thay đổi. Sao này chủ về thanh cao, khi ở miếu địa tại Thiên Di tạo nên khả năng phát huy đầy đủ tính chất. Người có Liêm Trinh miếu địa tại Thiên Di thường có khả năng chính trực, dễ dàng đạt được thành tựu và phát triển. Tính cách thanh cao giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường di chuyển, du lịch, thay đổi một cách hiệu quả, với khả năng trung thực và chính trực. Thiên Di của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua thanh cao.', 'positive', 0),
