('LIEM_TRINH_THIEN_DI_DAC', 'Liêm Trinh đắc địa tại cung Thiên Di thể hiện khả năng thanh cao và trung thực trong lĩnh vực di chuyển, du lịch, thay đổi. Sao này chủ về thanh cao, khi ở đắc địa tại Thiên Di tạo nên khả năng phát huy đầy đủ tính chất. Người có Liêm Trinh đắc địa tại Thiên Di thường có khả năng chính trực, dễ dàng đạt được thành tựu và phát triển. Tính cách thanh cao giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường di chuyển, du lịch, thay đổi một cách hiệu quả, với khả năng trung thực và chính trực. Thiên Di của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua thanh cao.', 'positive', 0),
('LIEM_TRINH_THIEN_DI_BINH', 'Liêm Trinh bình địa tại cung Thiên Di thể hiện khả năng di chuyển, du lịch, thay đổi ở mức độ trung bình, không có sự nổi bật đặc biệt về thanh cao. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Liêm Trinh bình địa tại Thiên Di thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể di chuyển, du lịch, thay đổi ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Thiên Di của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển thanh cao để nâng cao chất lượng.', 'neutral', 0),
('LIEM_TRINH_THIEN_DI_HAM', 'Liêm Trinh hãm địa tại cung Thiên Di cho thấy khó khăn trong việc di chuyển, du lịch, thay đổi. hãm địa là trạng thái bất lợi, khiến Liêm Trinh không thể phát huy các mặt tích cực. Người có Liêm Trinh hãm địa tại Thiên Di thường gặp khó khăn trong việc thanh cao, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Thiên Di của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
