INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('CU_MON_QUAN_LOC_MIEU', 'Cự Môn miếu địa tại cung Quan Lộc thể hiện khả năng giao tiếp và học hỏi trong lĩnh vực công việc, sự nghiệp, địa vị. Sao này chủ về giao tiếp, khi ở miếu địa tại Quan Lộc tạo nên khả năng phát huy đầy đủ tính chất. Người có Cự Môn miếu địa tại Quan Lộc thường có khả năng kiến thức, dễ dàng đạt được thành tựu và phát triển. Tính cách giao tiếp giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường công việc, sự nghiệp, địa vị một cách hiệu quả, với khả năng học hỏi và kiến thức. Quan Lộc của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua giao tiếp.', 'positive', 0),
