('CU_MON_TAI_BACH_BINH', 'Cự Môn bình địa tại cung Tài Bạch thể hiện khả năng tiền bạc, tài chính, thu nhập ở mức độ trung bình, không có sự nổi bật đặc biệt về giao tiếp. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Cự Môn bình địa tại Tài Bạch thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể tiền bạc, tài chính, thu nhập ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Tài Bạch của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển giao tiếp để nâng cao chất lượng.', 'neutral', 0),
('CU_MON_TAI_BACH_HAM', 'Cự Môn hãm địa tại cung Tài Bạch cho thấy khó khăn trong việc tiền bạc, tài chính, thu nhập. hãm địa là trạng thái bất lợi, khiến Cự Môn không thể phát huy các mặt tích cực. Người có Cự Môn hãm địa tại Tài Bạch thường gặp khó khăn trong việc giao tiếp, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Tài Bạch của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
