('CU_MON_PHU_THE_HAM', 'Cự Môn hãm địa tại cung Phu Thê cho thấy khó khăn trong việc hôn nhân, mối quan hệ vợ chồng. hãm địa là trạng thái bất lợi, khiến Cự Môn không thể phát huy các mặt tích cực. Người có Cự Môn hãm địa tại Phu Thê thường gặp khó khăn trong việc giao tiếp, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Phu Thê của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
