('CU_MON_DIEN_TRACH_MIEU', 'Cự Môn miếu địa tại cung Điền Trạch thể hiện khả năng giao tiếp và học hỏi trong lĩnh vực nhà cửa, bất động sản, tài sản. Sao này chủ về giao tiếp, khi ở miếu địa tại Điền Trạch tạo nên khả năng phát huy đầy đủ tính chất. Người có Cự Môn miếu địa tại Điền Trạch thường có khả năng kiến thức, dễ dàng đạt được thành tựu và phát triển. Tính cách giao tiếp giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường nhà cửa, bất động sản, tài sản một cách hiệu quả, với khả năng học hỏi và kiến thức. Điền Trạch của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua giao tiếp.', 'positive', 0),
('CU_MON_DIEN_TRACH_VUONG', 'Cự Môn vượng địa tại cung Điền Trạch thể hiện khả năng giao tiếp và học hỏi trong lĩnh vực nhà cửa, bất động sản, tài sản. Sao này chủ về giao tiếp, khi ở vượng địa tại Điền Trạch tạo nên khả năng phát huy đầy đủ tính chất. Người có Cự Môn vượng địa tại Điền Trạch thường có khả năng kiến thức, dễ dàng đạt được thành tựu và phát triển. Tính cách giao tiếp giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường nhà cửa, bất động sản, tài sản một cách hiệu quả, với khả năng học hỏi và kiến thức. Điền Trạch của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua giao tiếp.', 'positive', 0),
('CU_MON_DIEN_TRACH_DAC', 'Cự Môn đắc địa tại cung Điền Trạch thể hiện khả năng giao tiếp và học hỏi trong lĩnh vực nhà cửa, bất động sản, tài sản. Sao này chủ về giao tiếp, khi ở đắc địa tại Điền Trạch tạo nên khả năng phát huy đầy đủ tính chất. Người có Cự Môn đắc địa tại Điền Trạch thường có khả năng kiến thức, dễ dàng đạt được thành tựu và phát triển. Tính cách giao tiếp giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường nhà cửa, bất động sản, tài sản một cách hiệu quả, với khả năng học hỏi và kiến thức. Điền Trạch của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua giao tiếp.', 'positive', 0),
('CU_MON_DIEN_TRACH_BINH', 'Cự Môn bình địa tại cung Điền Trạch thể hiện khả năng nhà cửa, bất động sản, tài sản ở mức độ trung bình, không có sự nổi bật đặc biệt về giao tiếp. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Cự Môn bình địa tại Điền Trạch thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể nhà cửa, bất động sản, tài sản ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Điền Trạch của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển giao tiếp để nâng cao chất lượng.', 'neutral', 0),
('CU_MON_DIEN_TRACH_HAM', 'Cự Môn hãm địa tại cung Điền Trạch cho thấy khó khăn trong việc nhà cửa, bất động sản, tài sản. hãm địa là trạng thái bất lợi, khiến Cự Môn không thể phát huy các mặt tích cực. Người có Cự Môn hãm địa tại Điền Trạch thường gặp khó khăn trong việc giao tiếp, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Điền Trạch của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
