('CU_MON_HUYNH_DE_MIEU', 'Cự Môn miếu địa tại cung Huynh Đệ thể hiện khả năng giao tiếp và học hỏi trong lĩnh vực anh chị em, bạn bè, tương trợ. Sao này chủ về giao tiếp, khi ở miếu địa tại Huynh Đệ tạo nên khả năng phát huy đầy đủ tính chất. Người có Cự Môn miếu địa tại Huynh Đệ thường có khả năng kiến thức, dễ dàng đạt được thành tựu và phát triển. Tính cách giao tiếp giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường anh chị em, bạn bè, tương trợ một cách hiệu quả, với khả năng học hỏi và kiến thức. Huynh Đệ của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua giao tiếp.', 'positive', 0),
