('THIEN_DONG_TU_TUC_BINH', 'Thiên Đồng bình địa tại cung Tử Tức thể hiện khả năng con cái, giáo dục, tương lai ở mức độ trung bình, không có sự nổi bật đặc biệt về hài hòa. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thiên Đồng bình địa tại Tử Tức thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể con cái, giáo dục, tương lai ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Tử Tức của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển hài hòa để nâng cao chất lượng.', 'neutral', 0),
('THIEN_DONG_TU_TUC_HAM', 'Thiên Đồng hãm địa tại cung Tử Tức cho thấy khó khăn trong việc con cái, giáo dục, tương lai. hãm địa là trạng thái bất lợi, khiến Thiên Đồng không thể phát huy các mặt tích cực. Người có Thiên Đồng hãm địa tại Tử Tức thường gặp khó khăn trong việc hài hòa, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Tử Tức của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
