INSERT INTO interpretation_fragments (fragment_code, content, tone, priority) VALUES
('THIEN_DONG_NO_BOC_MIEU', 'Thiên Đồng miếu địa tại cung Nô Bộc thể hiện khả năng hài hòa và vui vẻ trong lĩnh vực bạn bè, đồng nghiệp, hợp tác. Sao này chủ về hài hòa, khi ở miếu địa tại Nô Bộc tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Đồng miếu địa tại Nô Bộc thường có khả năng lạc quan, dễ dàng đạt được thành tựu và phát triển. Tính cách hài hòa giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường bạn bè, đồng nghiệp, hợp tác một cách hiệu quả, với khả năng vui vẻ và lạc quan. Nô Bộc của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua hài hòa.', 'positive', 0),
('THIEN_DONG_NO_BOC_VUONG', 'Thiên Đồng vượng địa tại cung Nô Bộc thể hiện khả năng hài hòa và vui vẻ trong lĩnh vực bạn bè, đồng nghiệp, hợp tác. Sao này chủ về hài hòa, khi ở vượng địa tại Nô Bộc tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Đồng vượng địa tại Nô Bộc thường có khả năng lạc quan, dễ dàng đạt được thành tựu và phát triển. Tính cách hài hòa giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường bạn bè, đồng nghiệp, hợp tác một cách hiệu quả, với khả năng vui vẻ và lạc quan. Nô Bộc của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua hài hòa.', 'positive', 0),
('THIEN_DONG_NO_BOC_DAC', 'Thiên Đồng đắc địa tại cung Nô Bộc thể hiện khả năng hài hòa và vui vẻ trong lĩnh vực bạn bè, đồng nghiệp, hợp tác. Sao này chủ về hài hòa, khi ở đắc địa tại Nô Bộc tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Đồng đắc địa tại Nô Bộc thường có khả năng lạc quan, dễ dàng đạt được thành tựu và phát triển. Tính cách hài hòa giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường bạn bè, đồng nghiệp, hợp tác một cách hiệu quả, với khả năng vui vẻ và lạc quan. Nô Bộc của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua hài hòa.', 'positive', 0),
('THIEN_DONG_NO_BOC_BINH', 'Thiên Đồng bình địa tại cung Nô Bộc thể hiện khả năng bạn bè, đồng nghiệp, hợp tác ở mức độ trung bình, không có sự nổi bật đặc biệt về hài hòa. bình địa là trạng thái không có lợi cũng không có hại rõ rệt. Người có Thiên Đồng bình địa tại Nô Bộc thường có khả năng ổn định, hoàn thành các nhiệm vụ cơ bản nhưng ít có thành tựu nổi bật. Trong thực tế, họ thể hiện tính cách trung hòa, có thể bạn bè, đồng nghiệp, hợp tác ở mức độ cơ bản nhưng khó đạt được thành tựu lớn. Nô Bộc của họ có xu hướng phát triển chậm, cần nhiều thời gian và nỗ lực để cải thiện. Họ cần chủ động phát triển hài hòa để nâng cao chất lượng.', 'neutral', 0),
('THIEN_DONG_NO_BOC_HAM', 'Thiên Đồng hãm địa tại cung Nô Bộc cho thấy khó khăn trong việc bạn bè, đồng nghiệp, hợp tác. hãm địa là trạng thái bất lợi, khiến Thiên Đồng không thể phát huy các mặt tích cực. Người có Thiên Đồng hãm địa tại Nô Bộc thường gặp khó khăn trong việc hài hòa, dễ bị rối loạn khi đối mặt với tình huống phức tạp. Họ có xu hướng thiếu tự tin, khó khăn trong việc đạt được mục tiêu và thường cần sự hỗ trợ. Trong thực tế, họ có thể gặp trở ngại, dễ bỏ lỡ cơ hội. Nô Bộc của họ có xu hướng phát triển chậm, cần nhiều nỗ lực để vượt qua khó khăn.', 'negative', 0)
