('THIEN_DONG_HUYNH_DE_MIEU', 'Thiên Đồng miếu địa tại cung Huynh Đệ thể hiện khả năng hài hòa và vui vẻ trong lĩnh vực anh chị em, bạn bè, tương trợ. Sao này chủ về hài hòa, khi ở miếu địa tại Huynh Đệ tạo nên khả năng phát huy đầy đủ tính chất. Người có Thiên Đồng miếu địa tại Huynh Đệ thường có khả năng lạc quan, dễ dàng đạt được thành tựu và phát triển. Tính cách hài hòa giúp họ vượt qua các thách thức và tạo dựng được vị thế. Trong thực tế, họ thường anh chị em, bạn bè, tương trợ một cách hiệu quả, với khả năng vui vẻ và lạc quan. Huynh Đệ của họ có xu hướng phát triển tích cực, với nhiều cơ hội để thể hiện năng lực và đạt được mục tiêu thông qua hài hòa.', 'positive', 0),
